import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import "../Inthewomb/Slick.css";
import week1 from "../images/Pregnancy by week/1-week-pregnant.png";
import week2 from "../images/Pregnancy by week/2-week-pregnant.png";
import week3 from "../images/Pregnancy by week/3-week-pregnant.png";
import week4 from "../images/Pregnancy by week/4-week-pregnant.png";
import week5 from "../images/Pregnancy by week/5-week-pregnant.png";
import week6 from "../images/Pregnancy by week/6-week-pregnant.png";
import week7 from "../images/Pregnancy by week/7-week-pregnant.png";
import week8 from "../images/Pregnancy by week/8-week-pregnant.png";
import week9 from "../images/Pregnancy by week/9-week-pregnant.png";
import week10 from "../images/Pregnancy by week/10-week-pregnant.png";
import week11 from "../images/Pregnancy by week/11-week-pregnant.png";
import week12 from "../images/Pregnancy by week/12-week-pregnant.png";
import week13 from "../images/Pregnancy by week/13-week-pregnant.png";
import week14 from "../images/Pregnancy by week/14-week-pregnant.png";
import week15 from "../images/Pregnancy by week/15-week-pregnant.png";


export default class Responsive extends Component {
  render() {
    var settings = {
      dots: true,
      infinite: false,
      speed: 500,
      slidesToShow: 4,
      slidesToScroll: 4,
      initialSlide: 0,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    };
    return (
      <div>
        <h2 className="main-head2"> First Trimester</h2>
        <Slider {...settings}>
          <div>
            <img src={week1} />
            <h3 className='byweek'>week 1</h3>
          </div>
          <div>
          <img src={week2} />
            <h3 className='byweek'>week 2</h3>
          </div>
          <div>
          <img src={week3} />
            <h3 className='byweek'>week 3</h3>
          </div>
          <div>
          <img src={week4} />
            <h3 className='byweek'>week 4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
          <div>
            <h3>7</h3>
          </div>
          <div>
            <h3>8</h3>
          </div>
        </Slider>
      </div>
    );
  }
}
